import { useCallback } from "react";

export function CustomHookChildOne({ city }) {
  const memoizedCallback = useCallback(() => {
    fetch(
      `http://api.weatherapi.com/v1/current.json?key=ed717cd058ef408d89905156212308&q=${city}&aqi=no`
    )
      .then((res) => res.json())
      .then(
        (result) => {
          return result.current.temp_f;
        },
        (error) => {
          return "0";
        }
      );
  }, [city]);

  return <p>temp: {memoizedCallback()}</p>;
}

export default function CustomHookParent() {
  return (
    <div>
      <CustomHookChildOne city="Philadelphia" />
    </div>
  );
}
